import { Link } from "react-router-dom";
import Header from '../components/Header';
import { guitar, frenchhorn, piano, drums } from "../data/instruments.js";
import { useParams } from "react-router-dom";
import { useEffect, useState } from 'react';

const letters = ['a', 'b', 'c', 'd', 'e', 'f', 'g'];

const baseURL = "https://comp2140.uqcloud.net/api/";
const apiKey = "Q9vUXvhPOt";

function Edit({ toneObject, toneTransport}) {
    let { id } = useParams();

    const [loading, setLoading] = useState(true);

    const [saving, setSaving] = useState(false);

    const initialSequence = [];
    const newSequence = [];
    for(let bar = 1; bar <= 16; bar++) newSequence.push(false);

    letters.forEach(letter => initialSequence.push({note: letter, sequence: newSequence}))

    const [sequence, setSequence] = useState(initialSequence);

    const initialInstrument = "G";
    const [instrument, setInstrument] = useState(initialInstrument);

    const [title, setTitle] = useState('');
    let data = [];

    useEffect(() => {
        const fetchData = async () => {
            try {
                const response = await fetch(baseURL + "sample/" + id + "/?api_key=" + apiKey);
                data = await response.json();
                console.log(data.name);
            } catch (error) {
                console.error("Error fetching sample", error);
            } finally {
                setLoading(false);
                if (data.name != null) {
                    setTitle(data.name);
                    setInstrument(data.type);
                    setSequence(JSON.parse(data.recording_data));
                }
            }
        };

        if (id != "new") fetchData();
        else setLoading(false);

        }, []);

    const saveTitle = (event) => {
        setTitle(event.target.value);
      };

    async function CreateSample() {
        let method = "PUT";
        let idText = id + "/";
        if (id == "new") {
            method = "POST";
            idText = "";
        }
        let json = {};
        try {
            setSaving(true);
            const url = `${baseURL}sample/${idText}?api_key=${apiKey}`;
            const data = {
                            'type': instrument, 
                            'name': title, 
                            'recording_data': JSON.stringify(sequence),
                            'api_key': apiKey
                        }

            const response = await fetch(url, {
                method: method,
                headers: {
                'Accept': 'application/json',
                'Content-Type': 'application/json'
                },
                body: JSON.stringify(data)
        });
        json = await response.json();
        console.log(json);
      } finally {
        setSaving(false);
        id = json.id.toString();
      }
      return json;
    }


    function updateSequence(note, bar) {
        let filtered = [];
        let oldS = [];
        sequence.forEach(item => {
            if (item.note === note) oldS = item;
            else filtered.push(item);
        });

        let newS = [];
        for (let i = 1; i <= 16; i++) {
            if (i == bar) newS.push(!oldS.sequence[i - 1]);
            else newS.push(oldS.sequence[i - 1]);
        }

        setSequence([...filtered, {note: note, sequence: newS}]);

        switch (instrument) {
            case "G":
                switch (note) {
                    case "b":
                        guitar.triggerAttackRelease("B4", "8n");
                        break;
                    case "a":
                        guitar.triggerAttackRelease("A4", "8n");
                        break;
                    case "g":
                        guitar.triggerAttackRelease("G4", "8n");
                        break;
                    case "f":
                        guitar.triggerAttackRelease("F4", "8n");
                        break;
                    case "e":
                        guitar.triggerAttackRelease("E4", "8n");
                        break;
                    case "d":
                        guitar.triggerAttackRelease("D4", "8n");
                        break;
                    case "c":
                        guitar.triggerAttackRelease("C4", "8n");
                        break;
                }
                break;
            case "P":
                switch (note) {
                    case "b":
                        piano.triggerAttackRelease("B4", "8n");
                        break;
                    case "a":
                        piano.triggerAttackRelease("A4", "8n");
                        break;
                    case "g":
                        piano.triggerAttackRelease("G4", "8n");
                        break;
                    case "f":
                        piano.triggerAttackRelease("F4", "8n");
                        break;
                    case "e":
                        piano.triggerAttackRelease("E4", "8n");
                        break;
                    case "d":
                        piano.triggerAttackRelease("D4", "8n");
                        break;
                    case "c":
                        piano.triggerAttackRelease("C4", "8n");
                        break;
                }
                break;
            case "F":
                switch (note) {
                    case "b":
                        frenchhorn.triggerAttackRelease("C4", "8n");
                        break;
                    case "a":
                        frenchhorn.triggerAttackRelease("A3", "8n");
                        break;
                    case "g":
                        frenchhorn.triggerAttackRelease("G2", "8n");
                        break;
                    case "f":
                        frenchhorn.triggerAttackRelease("F3", "8n");
                        break;
                    case "e":
                        frenchhorn.triggerAttackRelease("D5", "8n");
                        break;
                    case "d":
                        frenchhorn.triggerAttackRelease("D3", "8n");
                        break;
                    case "c":
                        frenchhorn.triggerAttackRelease("C2", "8n");
                        break;
                }
                break;
            case "D":
                switch (note) {
                    case "b":
                        drums.triggerAttackRelease("B4", "8n");
                        break;
                    case "a":
                        drums.triggerAttackRelease("A4", "8n");
                        break;
                    case "g":
                        drums.triggerAttackRelease("G4", "8n");
                        break;
                    case "f":
                        drums.triggerAttackRelease("F4", "8n");
                        break;
                    case "e":
                        drums.triggerAttackRelease("E4", "8n");
                        break;
                    case "d":
                        drums.triggerAttackRelease("D4", "8n");
                        break;
                    case "c":
                        drums.triggerAttackRelease("C4", "8n");
                        break;
                }
                break;
        }
    }

    function printText() {
        console.log(title);
    }

